#
# Structure for table "data_kas"
#

DROP TABLE IF EXISTS `data_kas`;
CREATE TABLE `data_kas` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `jenis_anggaran` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'murni',
  `tahun` smallint(6) DEFAULT '2018',
  `kode_dpa` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `kode_rekening` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `jenis` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `level` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `bulan` tinyint(4) NOT NULL,
  `sisa_bulan_lalu` double NOT NULL DEFAULT '0',
  `rencana` double NOT NULL DEFAULT '0',
  `indikatif` double NOT NULL DEFAULT '0',
  `diajukan` double NOT NULL DEFAULT '0',
  `disetujui` double NOT NULL DEFAULT '0',
  `sisa_bulan_ini` double NOT NULL DEFAULT '0',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=603 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

