#
# Structure for table "lampiran_perjadin_biaya"
#

DROP TABLE IF EXISTS `lampiran_perjadin_biaya`;
CREATE TABLE `lampiran_perjadin_biaya` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `urut` tinyint(4) NOT NULL DEFAULT '0',
  `perjadin_id` int(11) DEFAULT NULL,
  `perjadin_detail_id` int(11) DEFAULT NULL,
  `rincian` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `harga` double NOT NULL DEFAULT '0',
  `volume` double NOT NULL DEFAULT '0',
  `satuan` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `jumlah` double NOT NULL DEFAULT '0',
  `keterangan` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1202 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

