#
# View "rekap_berkas_spj"
#

DROP VIEW IF EXISTS `rekap_berkas_spj`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `rekap_berkas_spj`
  AS
  SELECT
    `permohonan_gu`.`id` AS 'permohonan_id',
    `permohonan_gu`.`jenis_anggaran` AS 'permohonan_jenis_anggaran',
    `permohonan_gu`.`tahun` AS 'permohonan_tahun',
    `permohonan_gu`.`kode_dpa` AS 'permohonan_kode_dpa',
    `permohonan_gu`.`kegiatan` AS 'permohonan_kegiatan',
    `permohonan_gu`.`nomor_urut` AS 'permohonan_nomor_urut',
    `permohonan_gu`.`nomor_permohonan` AS 'permohonan_nomor_permohonan',
    `permohonan_gu`.`tanggal` AS 'permohonan_tanggal',
    `permohonan_gu`.`nominal_diajukan` AS 'permohonan_nominal_diajukan',
    `permohonan_gu`.`nominal_disetujui` AS 'permohonan_nominal_disetujui',
    `spj`.`id` AS 'spj_id',
    `spj`.`jenis_anggaran` AS 'spj_jenis_anggaran',
    `spj`.`tahun` AS 'spj_tahun',
    `spj`.`permohonan_jenis` AS 'spj_permohonan_jenis',
    `spj`.`permohonan_id` AS 'spj_permohonan_id',
    `spj`.`kode_dpa` AS 'spj_kode_dpa',
    `spj`.`kegiatan` AS 'spj_kegiatan',
    `spj`.`tanggal` AS 'spj_tanggal',
    `spj`.`nominal_diajukan` AS 'spj_nominal_diajukan',
    `spj`.`nominal_disetujui` AS 'spj_nominal_disetujui',
    `spj`.`nominal_spj` AS 'spj_nominal_spj',
    `spj`.`nominal_sisa` AS 'spj_nominal_sisa'
  FROM
    (`spj`
      JOIN `permohonan_gu` ON ((`permohonan_gu`.`id` = `spj`.`permohonan_id`)));

#
# View "rekap_honor"
#

DROP VIEW IF EXISTS `rekap_honor`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `rekap_honor`
  AS
  SELECT
    `id` AS 'lampiran_honor_id',
    `jenis_anggaran` AS 'lampiran_honor_jenis_anggaran',
    `tahun` AS 'lampiran_honor_tahun',
    `bulan` AS 'lampiran_honor_bulan',
    `jenis` AS 'lampiran_honor_jenis',
    `uraian` AS 'lampiran_honor_uraian',
    `kode_dpa` AS 'lampiran_honor_kode_dpa',
    `kode_rekening` AS 'lampiran_honor_kode_rekening',
    `kegiatan` AS 'lampiran_honor_kegiatan',
    `rincian` AS 'lampiran_honor_rincian',
    `tanggal` AS 'lampiran_honor_tanggal',
    `subtotal` AS 'lampiran_honor_subtotal',
    `pph_21` AS 'lampiran_honor_pph_21',
    `pph_22` AS 'lampiran_honor_pph_22',
    `pph_23` AS 'lampiran_honor_pph_23',
    `total` AS 'lampiran_honor_total',
    `kpa_id` AS 'lampiran_honor_kpa_id',
    `pptk_id` AS 'lampiran_honor_pptk_id',
    `bendahara_id` AS 'lampiran_honor_bendahara_id',
    `pimpinan_id` AS 'lampiran_honor_pimpinan_id'
  FROM
    `lampiran_honor`;

#
# View "rekap_perjadin"
#

DROP VIEW IF EXISTS `rekap_perjadin`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `rekap_perjadin`
  AS
  SELECT
    `lampiran_perjadin`.`id` AS 'lampiran_perjadin_id',
    `lampiran_perjadin`.`jenis_anggaran` AS 'lampiran_perjadin_jenis_anggaran',
    `lampiran_perjadin`.`tahun` AS 'lampiran_perjadin_tahun',
    `lampiran_perjadin`.`kode_dpa` AS 'lampiran_perjadin_kode_dpa',
    `lampiran_perjadin`.`kode_rekening` AS 'lampiran_perjadin_kode_rekening',
    `lampiran_perjadin`.`kegiatan` AS 'lampiran_perjadin_kegiatan',
    `lampiran_perjadin`.`rincian` AS 'lampiran_perjadin_rincian',
    `lampiran_perjadin`.`nomor_urut` AS 'lampiran_perjadin_nomor_urut',
    `lampiran_perjadin`.`nomor_spt` AS 'lampiran_perjadin_nomor_spt',
    `lampiran_perjadin`.`tanggal` AS 'lampiran_perjadin_tanggal',
    `lampiran_perjadin`.`uraian` AS 'lampiran_perjadin_uraian',
    `lampiran_perjadin`.`lokasi_id` AS 'lampiran_perjadin_lokasi_id',
    `lampiran_perjadin`.`lokasi_nama` AS 'lampiran_perjadin_lokasi_nama',
    `lampiran_perjadin`.`tempat_tujuan` AS 'lampiran_perjadin_tempat_tujuan',
    `lampiran_perjadin`.`nominal` AS 'lampiran_perjadin_nominal',
    `lampiran_perjadin`.`tanggal_berangkat` AS 'lampiran_perjadin_tanggal_berangkat',
    `lampiran_perjadin`.`tanggal_kembali` AS 'lampiran_perjadin_tanggal_kembali',
    `lampiran_perjadin`.`lama_perjalanan` AS 'lampiran_perjadin_lama_perjalanan',
    `lampiran_perjadin`.`keterangan` AS 'lampiran_perjadin_keterangan',
    `lampiran_perjadin`.`kpa_id` AS 'lampiran_perjadin_kpa_id',
    `lampiran_perjadin`.`pptk_id` AS 'lampiran_perjadin_pptk_id',
    `lampiran_perjadin`.`bendahara_id` AS 'lampiran_perjadin_bendahara_id',
    `lampiran_perjadin`.`pimpinan_id` AS 'lampiran_perjadin_pimpinan_id',
    `data_pegawai`.`nama` AS 'data_pegawai_nama'
  FROM
    ((`lampiran_perjadin`
      JOIN `lampiran_perjadin_detail` ON ((`lampiran_perjadin_detail`.`perjadin_id` = `lampiran_perjadin`.`id`)))
      JOIN `data_pegawai` ON ((`lampiran_perjadin_detail`.`pegawai_id` = `data_pegawai`.`id`)));
